import React from 'react'

function Details({person, personToRemove}){
    const {First_Name, Last_Name, Sex, RegNumber, Program, Postion} = person

    const onDelete = () => {
        personToRemove(First_Name, Last_Name, RegNumber)
    }

    return (
        <div className="card" style={{width: '18rem', marginTop: '1rem'}}>
            <div className="card-body">
                <h5 className="card-title">{First_Name}</h5>
                <h6 className="card-subtitle mb-2 text-muted">{RegNumber}</h6>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <button onClick={onDelete} className="btn btn-danger">Delete</button>
            </div>
        </div>
    )
}

export default Details
